// import React, { useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import { useEffect, useState } from "react";
import DisplayProjects from "../DisplayProjects";
import Toolbar from "@mui/material/Toolbar";
import Nav from "../Nav";

export default function Projects() {
  const [data, setData] = useState([]);
  const { type } = useParams();

  useEffect(() => {
    axios.get(`http://localhost:5000/projects/${type}`).then((res) => {
      console.log(res);

      console.log(res.data.type);
      setData(res.data);
      console.log(data);
    });
  }, []);

  return (
    <>
      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{ backgroundColor: "#00468B" }}>
        <Toolbar>
          <img
            src={logo}
            alt=""
            width="2.5%"
            style={{ margin: "10px 0px 10px 20px" }}
          />

          <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ "aria-label": "search" }}
            />
          </Search>
          <Box sx={{ flexGrow: 1 }} />
          <Box sx={{ display: { xs: "none", md: "flex" } }}>
            <IconButton
              size="large"
              aria-label="show 4 new mails"
              color="inherit"
            >
              <Badge badgeContent={4} color="error">
                <SendIcon />
              </Badge>
            </IconButton>

            <IconButton
              size="large"
              edge="end"
              aria-label="account of current user"
              aria-controls={menuId}
              aria-haspopup="true"
              onClick={handleProfileMenuOpen}
              color="inherit"
            >
              <AccountCircle />
            </IconButton>
          </Box>
          <Box sx={{ display: { xs: "flex", md: "none" } }}>
            <IconButton
              size="large"
              aria-label="show more"
              aria-controls={mobileMenuId}
              aria-haspopup="true"
              onClick={handleMobileMenuOpen}
              color="inherit"
            >
              <MoreIcon />
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>
      {renderMobileMenu}
      {renderMenu}
    </Box>



      <Toolbar id="back-to-top-anchor" />
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr 1fr",
          gridRowGap: "50px",
          marginLeft: "150px",
          marginBottom: "100px",
          marginTop: "100px",
        }}
      >
        {data.map((elem) => {
          return (
            <DisplayProjects
              url={elem.img}
              leader={elem.leader}
              date={elem.date}
              name={elem.name}
              type={elem.type}
              desc={elem.desc}
              team={elem.teamNeeded}
              level={elem.level}
              location={elem.location}
            />
          );
        })}
      </div>
    </>
  );
}
